  import * as React from 'react';
  import Box from '@mui/material/Box';
  import Link from '@mui/material/Link';
  import Grid from "@mui/material/Grid";
  import ThreeSixtyIcon from "@mui/icons-material/ThreeSixty";



  
  const Footer = () => {
    return(
  <Box sx={{ bgcolor: '#6ECCAF', p: 7 }} component="footer">
        <Box sx={{bgcolor:'red',width:'100px'}}>
        <Grid>
            <Grid>
            <Grid item xs={4}>
            <Link href="/"  variant="body2" underline="always" sx={{color:"purple",size:"50vh"}}>
                                        {"Home"}</Link>
             </Grid>
             <Grid item xs={8}>
                    <ThreeSixtyIcon />
                </Grid>

            </Grid>
         </Grid>
        </Box>
       
      </Box>);}
export default Footer;
